/*Estilos */
@import url("https://fonts.googleapis.com/css?family=Merriweather:400,400i,700,700i&display=swap");
@import url("https://fonts.googleapis.com/css2?family=Roboto+Condensed&display=swap");

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}


body {
  font: 400 16px/1.6 "Merriweather", serif;
  background-color: #6FB98F;
  color: rgb(2, 15, 20);
  overflow-x: hidden;
  word-wrap: break-word;
}

h1,
h2,
h3,
h4 {
  font-weight: 700;
}

h1,
.h1 {
  font-size: 2rem;
}

h2,
.h2 {
  font-size: 1.5rem;
  line-height: 1.5em;
  margin-bottom: 1.5rem;
}

h3,
.h3 {
  font-size: 1.35rem;
  line-height: 1em;
  margin-bottom: 1rem;
  text-align: center;
}

h4,
.h4 {
  font-size: 1.15rem;
  line-height: 1em;
  margin-bottom: 1rem;
}

p {
  font-size: 1rem;
  margin-bottom: 1rem;
}

@media (min-width: 768px) {
  h1,
  .h1 {
    font-size: 2.5rem;
  }
  h2,
  .h2 {
    font-size: 2rem;
  }
  h3,
  .h3 {
    font-size: 1.5rem;
  }
  h4,
  .h4 {
    font-size: 1.25rem;
  }
  p {
    font-size: 1.1rem;
  }
}

a {
  color: #021c1e;
  text-decoration: none;
}

a:hover {
  color: #2c7873;
}

abbr {
  text-decoration: none;
}

iframe {
  border: 0;
}

figcaption {
  font-size: 1rem;
  font-variant: small-caps;
}

/*Clases aplicadas a los elementos multimedia del sitio */
.imgFluid {
  max-width: 100%;
  height: auto;
}


.imgFluid3 {
  max-width: 100%;
  height: auto;

  animation: glow 1s infinite alternate;
}

@keyframes glow {
  from {
    box-shadow: 0 0 10px -10px blanchedalmond;
  }
  to {
    box-shadow: 0 0 10px 10px  blanchedalmond;
  }
}

.imgFluid2 {
  width: 20%;
  height: auto;
  float: left;

}

.videoFluid {
  position: relative;
  display: block;
  width: 50%;
  overflow: hidden;
}

.videoFluidItem {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 100%;
  border: 0;
}

.videoFluid::before {
  display: block;
  content: "";
  padding-top: 56.25%;
}

/*Clases para alineamiento de textos*/
.textJustify {
  text-align: justify;
}

.textCenter {
  text-align: center;
}

/*Clase para esconder un elemento que serÃ¡ Ãºnicamente visible a los lectores de pantalla*/
.sr {
  position: absolute;
  height: 1px;
  width: 1px;
  overflow: hidden;
  clip: rect(1px, 1px, 1px, 1px);
}

/****************************
Contenedores del sitio
*****************************/
main {
  width: 100%;
  padding: 50px 0;
}

header {
  padding: 15px 0;
}

footer {
  padding: 30px 0;
}



img.clip-animation  {

  display: block;
  margin-left: 15px;

  width: 200px;
  display: block;
  margin-left: auto;
  margin-right: auto;
  width: 50%
  
}

.clip-animation { 
  clip-path: polygon(0% 0%, 100% 0%, 100% 75%, 75% 75%, 75% 100%, 50% 75%, 0% 75%);
}

