/*Contenido del header*/
header {
  font-size: 1rem;
  text-align: center;
  display: flex;
  flex-direction: column;
}



.brand {
  display: flex;
  align-items: center;
  justify-content: center;
}

.brand h1 span:last-child {
  font-style: italic;
  font-weight: 400;
}

.brand img {
  margin-right: 15px;
}

.brand a {
  color: rgb(2, 15, 20);
}

.brand,
.navbar
 {
  margin-bottom: 15px;
}

@media (min-width: 992px) {
  header {
    display: flex;
    flex-direction: row;
 
    align-items: flex-end;
  }
  
  .brand,
  .navbar
  {
    margin-bottom: 0;
    padding-left: 40px;
  }

  img.clip-animation  {

    display: block;
    margin-left: 15px; 
    width: 200px;    
  }

}

/*Contenido del footer*/

footer {
  font-family: "Roboto Condensed", sans-serif;
  font-size: 0.9rem;
  position: relative;
  text-align: center;
  background-color: rgb(67, 58, 68);
  color: rgb(255, 255, 255);
}

footer p {
  font-size: 0.75rem;
  margin-bottom: 0;
}

.footer ul {
  list-style-type: none;
  padding: 30px 0;
  margin: 0;
}

footer h2{
  margin-left: 15px;
}

.goTop {
  position: absolute;
  right: 15px;
  bottom: 0px;
  font-size: 2rem;
  margin-right: 30px;
}

footer a {
  color: rgb(255, 255, 255);
}

footer a:hover {
  color: #2c7873;
}

@media (min-width: 768px) {
  footer {
    text-align: left;
  }
  .footer {
    display: flex;
    justify-content: space-between;
  }
  .footer ul li {
    display: inline-block;
  }
  .footer ul li::after {
    content: "â€¢";
    padding-right: 8px;
    padding-left: 8px;
  }
  .footer ul li:last-child::after {
    content: "";
    padding-right: 0;
    padding-left: 0;
  }

  img.clip-animation  {

    display: block;
    margin-left: 15px; 
    width: 200px;    
  }
}

