/****************************
MenÃºs de navegaciÃ³n del sitio
*****************************/

/*MenÃº principal*/
nav.navbar {
  font-family: "Roboto Condensed", sans-serif;
  text-transform: uppercase;
  font-size: x-large;

}

nav.navbar ul {
  list-style-type: none;
}

nav.navbar a {
  font-weight: 700;
  color: rgba(2, 15, 20, 1);
}

nav.navbar a:hover {
  color: rgba(2, 15, 20, 0.5);
}

nav.navbar a.active {
  color: #2c7873;
  font-weight: 700;
}

@media (min-width: 992px) {
  nav.navbar ul {
    display: flex;
    justify-content: space-between;
    align-items: center;
  }
  nav.navbar ul li {
    padding-left: 5px;
    padding-right: 40px;
  }

  
}



/****************************
PÃ¡gina de inicio
*****************************/

.home section + section {
  padding-top: 50px;
  padding-bottom: 50px;
}


ul.clubs {
  list-style-type: none;
}

ul.clubs li {
 padding: 15px;
}

ul.clubs li img {
  display: block;
  margin-left: auto;
  margin-right: auto;
}

ul.clubs li p:first-of-type {
  margin-top: 15px;
}

ul.clubs li p:first-of-type::before {
  content: " ";
  display: inline-block;
  width: 5%;
  height: 4px;
  background-color: rgb(2, 15, 20);
  margin-right: 15px;
  margin-bottom: 5px;
}

@media (min-width: 768px) {
  ul.clubs.gridContainer {
    display: grid;
    grid-template-columns: repeat(auto-fit, 50%);
  }
}

@media (min-width: 1200px) {
  ul.clubs.gridContainer {
    display: grid;
    grid-template-columns: repeat(auto-fit, 33.33333%);
  }
}

.content ul {
  list-style-type: none;
  padding-bottom: 30px;
}

.content ul li {
  background-color: rgb(255, 255, 255);
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  margin-bottom: 15px;
}

.content ul li p {
  margin: 10px;
}

.content ul li img:hover {
  opacity: 0.5;
}



@media (min-width: 768px) {
  .content ul {
    display: flex;
    justify-content: space-between;
  }
  .content ul li {
    width: 30%;
  }
  .intro p {
    width: 80%;
    margin-left: auto;
    margin-right: auto;
    line-height: 1.9em;
  }
 
  img.clip-animation  {

    display: block;
    margin-left: 15px; 
    width: 200px;    
  }
}

@media (min-width: 1200px) {
  .gridContainer2cols {
    display: grid;
    grid-template-columns: 5% auto;
    column-gap: 15px;
  }

  article {
    text-align: justify;
    hyphens: auto;
  }
 
}


